// use stack for better approach
var removeStars = function (s) {
  s = s.split("")
  let time = performance.now();
  for (let i = 0; i < s.length; i++) {
    if (s[i] == "*") {
      s.splice(i, 1);
      s.splice(i - 1, 1);
      i = i - 2;
      //console.log(s);
    }
  }
  time = performance.now() - time;
  console.log(time / 1000);
  if (!s.length) {
    return "empty";
  }
  return s.join("");
};
